import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/NavBar";
import Hero from "./components/Hero";
import Card from "./components/Card";

function App() {
  const numbers = [1, 3, 4, 5];
  numbers.map((nums) => console.log(nums));
  return (
    <div>
      <NavBar />
      <Hero />
      <Card
        avatar="https://semantic-ui.com/images/avatar2/large/matthew.png"
        name="Matthew"
        status="Friends"
        dateJoined="Joined in 2013"
        description="Matthew is an interior designer living in New York."
        friends={[{ number: 75, status: "friends" }]}
      />
      <Card
        avatar="https://semantic-ui.com/images/avatar2/large/molly.png"
        name="Molly"
        status="Coworker"
        dateJoined="Joined in 2000"
        description="Molly is a personal assistant living in Paris."
        friends={[{ number: 100, status: "friends" }]}
      />
      <Card
        avatar="https://semantic-ui.com/images/avatar2/small/rachel.png"
        name="Rachel"
        status="Coworker"
        dateJoined="Joined in 2019"
        description="Rachel is a software engineer living in Philippines."
        friends={[{ number: 25, status: "friends" }]}
      />
      <Card
        avatar="https://semantic-ui.com/images/avatar2/small/lindsay.png"
        name="Lindsay"
        status="Coworker"
        dateJoined="Joined in 2020"
        description="Lindsay is a personal Qa Tester living in Philippines."
        friends={[{ number: 55, status: "friends" }]}
      />
    </div>
  );
}

export default App;
